import { useState } from "react";
import PropTypes from 'prop-types'

import { 
  BrowserRouter,
  Routes,
  Route,
  useNavigate,
  Link, 
  Navigate
} from "react-router-dom";


const Rooms = ({userName}) => {
  let navigate = useNavigate();

  const back = async () => {
    navigate('/Dashboard');
  }

  const joinExistingRoom = async () => {
    navigate('/Room');
  }

  return (
    <div>
      <h1> Rooms</h1>
      <p>Hello  {userName}</p>
      <button onClick={back}> Back to Dashboard </button>

      <form className='card'> 
        <label> Room Number: </label>
      <input type='text'></input>
      <button type='submit' onClick={joinExistingRoom}> Join Room </button>
      </form>

      </div>
  )
}

Rooms.defaultProps = {
  userName: 'User123',
}

export default Rooms
